) A where (select count(1) from open.LDC_OTLEGALIZAR lo where lo.order_id= a.ot_padre) = 0 and (select count(1) from open.OR_ORDER oo where oo.order_id= a.ot_padre) = 1;

rfcuDATALEGO cuDATALEGO%rowtype;

begin
  dbms_output.put_line('Inicio Regsitro OT 12155 en LEGO');  
  for rfcuDATALEGO in cuDATALEGO loop    
    
    begin

      --Registro OT Padre LEGO
      insert into LDC_OTLEGALIZAR
        (ORDER_ID,
          CAUSAL_ID,
          ORDER_COMMENT,
          EXEC_INITIAL_DATE,
          EXEC_FINAL_DATE,
          LEGALIZADO,
          FECHA_REGISTRO,
          TASK_TYPE_ID,
          MENSAJE_LEGALIZADO)
      values
        (rfcuDATALEGO.ot_padre,
          rfcuDATALEGO.causal_padre,
          rfcuDATALEGO.ot_comentario,
          rfcuDATALEGO.fecha_leg_ini,
          rfcuDATALEGO.fecha_leg_fin,
          'N',
          sysdate,
          rfcuDATALEGO.tt_padre,
          null);

      --Registro DATA funcional asociado
      insert into LDC_ANEXOLEGALIZA
        (ORDER_ID, AGENTE_ID, TECNICO_UNIDAD)
      values
        (rfcuDATALEGO.ot_padre, rfcuDATALEGO.agente, /*rfcuDATALEGO.tecnico*/1);

      insert into LDC_OTADICIONAL
        (ORDER_ID, TASK_TYPE_ID, ACTIVIDAD, MATERIAL, CANTIDAD, CAUSAL_ID)
      values
        (rfcuDATALEGO.ot_padre,
          rfcuDATALEGO.tt_hijo,
          rfcuDATALEGO.actividad_hija,
          rfcuDATALEGO.item1_hijo,
          1,
          rfcuDATALEGO.causal_hija);

      insert into LDC_OTADICIONAL
        (ORDER_ID, TASK_TYPE_ID, ACTIVIDAD, MATERIAL, CANTIDAD, CAUSAL_ID)
      values
        (rfcuDATALEGO.ot_padre,
          rfcuDATALEGO.tt_hijo,
          rfcuDATALEGO.actividad_hija,
          rfcuDATALEGO.item2_hijo,
          1,
          rfcuDATALEGO.causal_hija);

      insert into LDC_OTADICIONALDA
        (ORDER_ID,
          TASK_TYPE_ID,
          CAUSAL_ID,
          NAME_ATTRIBUTE,
          VALUE,
          ACTIVIDAD,
          MATERIAL)
      values
        (rfcuDATALEGO.ot_padre,
          rfcuDATALEGO.tt_hijo,
          rfcuDATALEGO.causal_hija,
          '14054_REPARACION_REALIZADA_PUNTO_DISTINTO',
          'N',
          rfcuDATALEGO.actividad_hija,
          rfcuDATALEGO.item1_hijo);

      insert into LDC_OTADICIONALDA
        (ORDER_ID,
          TASK_TYPE_ID,
          CAUSAL_ID,
          NAME_ATTRIBUTE,
          VALUE,
          ACTIVIDAD,
          MATERIAL)
      values
        (rfcuDATALEGO.ot_padre,
          rfcuDATALEGO.tt_hijo,
          rfcuDATALEGO.causal_hija,
          '14054_USUARIO_O_TERCERO_OCASIONO_DANO',
          'S',
          rfcuDATALEGO.actividad_hija,
          rfcuDATALEGO.item1_hijo);

      commit;    

      dbms_output.put_line('Registro en LEGO de OT '|| rfcuDATALEGO.ot_padre || ' ok.'); 

    exception
      when others then                
        rollback;
        dbms_output.put_line('Error al Registrar la OT '|| rfcuDATALEGO.ot_padre || ' en lego. ' || sqlerrm);         
    end;     

  end loop;
  dbms_output.put_line('Fin Regsitro OT 12155 en LEGO');  
end;
